  const getUser = () => {
   
      Axios.get('http://localhost:4000/login').then( res => {
        console.log(res.data);
      })
  
  };
    
  return(
      <div class="Header">
            <h1>Lingo<span>Peer</span></h1>
            <nav>
                <ul>
                  <Link to="/apresConn">
                  <li>Home</li>
                  </Link>
                  <Link to="/Conn">
                  <li>AboutUs</li>
                  </Link>
                  <Link to="/Conn">
                  <li>Contact Us</li>
                  </Link>
                </ul>
            </nav>
            <Link to="/Profile">
            <button id="utilisateurBTN" onclick={getUser} >profile</button>
            </Link>
            <div>
        <h1>Get User</h1>
        <button onClick={getUser}>Submit</button>
        {data ? <h1>Welcome Back {data.username}</h1> : null}
      </div>
      </div>

    );
}
export default Header2;
